import React from 'react'
import { Section, Heading } from 'react-bulma-components';

const Vision = () => {
    return (
        <Section>
            <Heading>Our vision:</Heading>
            We enable seamless personalized services to the driver of the future.
        </Section>
    )
}

export default Vision
